import './styles/style.scss';
import Logo from './assets/Logo.JPG';
import Nav from './components/Nav';

function App() {
  return (
    <div className="App">
      <img src={Logo}></img>
      <Router>
                <Routes>
                    <Route path='/' exact component={Home}/>
                    <Route path='/about' exact component={About}/>
                    <Route path='/fiche_logement' exact component={Logements}/>
                    <Route path='/' component={Erreur_404}/>
                </Routes>
            </Router>
    </div>
  );
}

export default App;
